import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import CreateHID from './component/CreateHID';
import {Nav} from 'react-bootstrap'

function App() {
  return (
    <BrowserRouter>

      <Switch>
        <Route path="/"><CreateHID /></Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
